    }



    .web-inner {
        width: 1400px;
        height: 100%;
        margin: 0 auto;

        .section-header {
            position: fixed;
            top: 0;
            z-index: 99;
            transition: all 0.25s;
            background: white;
            width: 1400px;
            height: 100px;


            header {
                display: flex;
                width: inherit;
                height: inherit;
                justify-content: space-between;
                position: relative;


                .main-menu ul {
                    height: 100%;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    text-transform: uppercase;
                    font-family: 'Metal Mania', cursive;
                    font-size: 20px;
                    letter-spacing: 2px;

                    li {
                        margin: 0 10px;

                        a {
                            padding: 10px 10px;
                        }
                    }
                }

                .logo {
