                    height: inherit;
                }

                .user-menu ul {
                    height: 100%;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    text-transform: uppercase;
                    font-family: 'Nanum Gothic Coding', monospace;
                    font-size: 13px;

                    li {
                        &:last-child {
                            margin-right: 10px;
                        }

                        a {
                            padding: 10px 5px;
                        }
                    }
                }
            }
        }

        .section-header.unvisible {
